import React from "react";
import CurrentReading from "./CurrentReading";
import WantToRead from "./WantToRead";
import Read from "./Read";
function ListofBooks() {
  return (
    <React.Fragment>
      <CurrentReading />
      <WantToRead />
      <Read />
    </React.Fragment>
  );
}

export default ListofBooks;
